export default function ContentDetails() {
  return (
    <div className="content-details-container">
      <div className="item-poster-box">
        <img
          src={"https://cdn.myanimelist.net/images/anime/1171/109222l.jpg"}
          alt="k"
        />
      </div>
      <aside className="item-aside-box">Aside</aside>
      <div className="item-info-box">Info</div>
      <p className="item-description">Description</p>
    </div>
  );
}

function aside() {
  return (
    <>
      <div className="aside-item-box"></div>
      <div className="aside-item-box">
        <span className="aside-item"></span>
      </div>
    </>
  );
}
